{
  setpass(event.target.value)
}

  return (
    <form>
      <input onChange={handleuser} name="username" placeholder="username"></input>
      <input onChange={handlepass} name="password" placeholder="password"></input>
      <input type="submit"></input>
    </form>
  )
}

export default App
